import React from "react";
import './Card.css';
import Buttons from "../Buttons/Buttons"


function Card(props){
    return(
        <div id="main">
            <div id="perfil-post">
            <div id="imagem">
            <img src={props.imagem} alt="imagem"/>
            </div>
            <div id="buttons">
            <Buttons text/>
            <Buttons/>
            

            </div>
            </div>
        </div>
    );
};

export default Card;
